import React from 'react';
import './common/css/common.css';
import './common/css/library.css';
import MainContainer from "./pages/Main/maincontainer";
import LoginContainer from "./pages/Login/logincontainer";


function App() {
  return (
    <>
      <MainContainer />
      <LoginContainer />
    </>
  );
}

export default App;
